package gov.nist.hit.hl7.auth.converter;

public class OldAccount {
	Long id;
	String accountType;
	String email;
	String employer;
	String entityDisabled;
	String fullName;
	String juridiction;
	String pending;
	String phone;
	String signedConfidentialityAgreement;
	String title;
	String username;
	public OldAccount() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Long getId() {
		return id;
	}
	public void setId(Long id) {
		this.id = id;
	}
	public String getAccountType() {
		return accountType;
	}
	public void setAccountType(String accountType) {
		this.accountType = accountType;
	}
	public String getEmail() {
		return email;
	}
	public void setEmail(String email) {
		this.email = email;
	}
	public String getEmployer() {
		return employer;
	}
	public void setEmployer(String employer) {
		this.employer = employer;
	}
	public String getEntityDisabled() {
		return entityDisabled;
	}
	public void setEntityDisabled(String entityDisabled) {
		this.entityDisabled = entityDisabled;
	}
	public String getFullName() {
		return fullName;
	}
	public void setFullName(String fullName) {
		this.fullName = fullName;
	}
	public String getJuridiction() {
		return juridiction;
	}
	public void setJuridiction(String juridiction) {
		this.juridiction = juridiction;
	}
	public String getPending() {
		return pending;
	}
	public void setPending(String pending) {
		this.pending = pending;
	}
	public String getPhone() {
		return phone;
	}
	public void setPhone(String phone) {
		this.phone = phone;
	}
	public String getSignedConfidentialityAgreement() {
		return signedConfidentialityAgreement;
	}
	public void setSignedConfidentialityAgreement(String signedConfidentialityAgreement) {
		this.signedConfidentialityAgreement = signedConfidentialityAgreement;
	}
	public String getTitle() {
		return title;
	}
	public void setTitle(String title) {
		this.title = title;
	}
	public String getUsername() {
		return username;
	}
	public void setUsername(String username) {
		this.username = username;
	}

}
